function myFunction(){var i,x=document.forms.frm1,text="";for(i=0;i<x.length;i++)text+=x.elements[i].value+"<br>";document.getElementById("demo").innerHTML=text}function myMove(){function frame(){350==pos?clearInterval(id):(pos++,elem.style.top=pos+"px",elem.style.left=pos+"px")}var elem=document.getElementById("animate"),pos=0,id=setInterval(frame,5)}